import React from "react";
import img from "../img/Screenshot 2023-05-10 at 11.10.55 AM.png";

const styles = {
  right: {
    backgroundColor: "white",
    height: "100%",
    width: "50%",
    marginLeft: "50%",
  },
  container: {
    width: "100%",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  imgWrapper: {
    maxWidth: "100%",
    maxHeight: "100%",
  },
};

function Works() {
  return (
    <div className="right">
      <div style={styles.container}>
        <div className="img-wrapper">
          <img src={img}></img>
        </div>
      </div>
    </div>
  );
}

export default Works;
